import './section.css'
import {Card, CardBody, Col, Row} from "reactstrap";

const Section = () => {
    return (
        <div className='section'>
            <Row>
                <Col md={3}>
                    <Card className='ccc-5'>
                        wadadawdaw
                    </Card>
                </Col>
            </Row>
        </div>
    );
};

export default Section;
